// along with this program.  If not, see <http://www.gnu.org/licenses/>.

pragma solidity ^0.8.0;

import "/erc20/erc20.sol";
import "ds-math/math.sol";

abstract contract DSTokenBase is ERC20, DSMath {
    uint256                                            _supply;
    mapping (address => uint256)                       _balances;
    mapping (address => mapping (address => uint256))  _approvals;

     constructor (uint supply)  {
        _balances[msg.sender] = supply;
        _supply = supply;
    }

    function totalSupply() public view override returns (uint) {
        return _supply;
    }
    function balanceOf(address src) public view override returns (uint) {
        return _balances[src];
    }
    function allowance(address src, address guy) public override view returns (uint) {
        return _approvals[src][guy];
    }

    function transfer(address dst, uint wad) public override returns (bool) {
        return transferFrom(msg.sender, dst, wad);
    }

    function transferFrom(address src, address dst, uint wad)
        public  override virtual
        returns (bool)
    {
        if (src != msg.sender) {
            _approvals[src][msg.sender] = sub(_approvals[src][msg.sender], wad);
        }

        _balances[src] = sub(_balances[src], wad);
        _balances[dst] = add(_balances[dst], wad);

       emit Transfer(src, dst, wad);

        return true;
    }

    function approve(address guy, uint wad) public override virtual returns (bool) {
        _approvals[msg.sender][guy] = wad;

       emit Approval(msg.sender, guy, wad);

        return true;
    }
}

